                values: new object[] { 65, new DateTime(2023, 2, 7, 17, 25, 46, 888, DateTimeKind.Utc).AddTicks(4496), "Ostnák jihoamerický (Jacana jacana) je druh ptáka patřící do podřádu bahňáci. Je jedním z osmi druhů ostnáků.Má hnědá křídla a hřbet. Hlava a další části těla pak mají černou barvu. Zobák žluté barvy doplňuje červený čelní štítek. Typické jsou dlouhé nohy a prsty. Ostnák jihoamerický dosahuje délky 21 až 25 centimetrů a váhy 80 až 150 gramů. Samice jsou větší než samci. Ti se starají o stavbu hnízda, snůšku a mláďata. Samice se tak páří až se třemi, resp. čtyřmi samci (tzv. mnohomužství), z nichž všichni mohou mít svá vlastní mláďata, o která se starají. Samice v tu dobu hledají a lákají další samce a brání teritorium.Samice snáší čtyři vejce, která jsou následně inkubována po dobu 28 dní. Vyskytuje se v tropické Jižní Americe východně od And a v jižní Střední Americe, kde obývá tamní sladké vody (bažiny, mokřady, záplavové oblasti). Umí se pohybovat po listech rostlin, k čemuž slouží dlouhé prsty, díky nimž se váha ptáka rozkládá na větší plochu.Živí se vodními bezobratlými (zejména hmyzem), malými rybami či obojživelníky i semeny a dalšími částmi rostlin.", "Jacana jacana", "Ostnák jihoamerický", null });

