                values: new object[] { 117, new DateTime(2023, 2, 7, 17, 25, 46, 890, DateTimeKind.Utc).AddTicks(6406), "Čáp černý (Ciconia nigra) je zástupcem čeledi čápovitých (Ciconiidae). Je to velký, převážně černý pták s bronzovým leskem, červeným dlouhým zobákem a bílým břichem. Mezi samcem a samicí téměř není rozdíl, mláďata jsou matně hnědá s šedozeleným zobákem. Dožívá se věku přes 15 let.\nTento plachý, vzácnější obyvatel horských lesů, pahorkatin a lužních lesů žije jednotlivě a velmi skrytě. Hnízdo z klacků a větví bývá schováno v lesích v korunách starých stromů nebo na skalách. Je rozšířen ve většině střední a východní Evropy a v mírnějších oblastech Asie až po Dálný východ. Evropské a západoasijské populace táhnou na zimu do střední a západní Afriky, ostatní do Indie a Číny.\nŽiví se převážně rybami a dalšími drobnými živočichy, které loví hlavně v menších vodních tocích. Snáší obvykle 3–5 vajec, ze kterých se po měsíci líhnou mláďata s bílým prachovým peřím.", "Ciconia nigra", "Čáp černý", null });

