                values: new object[] { 51, new DateTime(2023, 2, 7, 17, 25, 46, 887, DateTimeKind.Utc).AddTicks(9541), "Tamarín bělovousý (Saguinus mystax) je druh opic, zástupce čeledi kosmanovitých (Callitrichidae) vyskytující se v Jižní Americe.\nŽije v tropických deštných lesích centrální Amazonie, konkrétně na území severního Peru a západní Brazílie. Tvoří rodinné skupiny o čtyřech až jedenácti jedincích. Jejich součástí je jedna samice, která se rozmnožuje. Po březosti o délce 145 dní se zpravidla rodí dvě mláďata. O ta se následně stará zejména otec. Matka mláďata pouze kojí.Živí se mízou, nektarem, plody a bezobratlými.Včetně ocasu dosahuje délky až 61 cm. Váží přibližně půl kilogramu. Dokáží se pohybovat velmi rychle, přičemž většinu života tráví na větvích.", "Saguinus mystax", "Tamarín bělovousý", null });

            migrationBuilder.InsertData(
