                values: new object[] { 47, new DateTime(2023, 2, 7, 17, 25, 46, 887, DateTimeKind.Utc).AddTicks(7573), "Slon africký (Loxodonta africana) je savec z řádu chobotnatců (Proboscidea). Je to největší suchozemský savec, který dorůstá výšky až 4 m. Slon africký se vyskytuje roztroušeně v celé Africe jižně od Sahelu, ale v dřívějších dobách se prokazatelně vyskytoval v mnohem hojnějším počtu na celém kontinentu, i v severní Africe. Obývá poměrně rozmanité prostředí. Slony můžeme najít v deštných lesích, na savanách a vystupují až do horských oblastí do 5000 m n. m. Sloni jsou poměrně přizpůsobiví – důležité je pro ně jen dostatek potravy a vody v teritoriu.\nOrganizace Great Elephant Census po nové důkladné analýze zjistila, že mezi lety 2007 a 2014 klesla populace slonů afrických o 30 %, asi o 144 000 jedinců. Podrobný průzkum kontinentu, 18 území (asi 93 % míst, kde tito sloni žijí), potvrzuje, že se v afrických savanách pohybuje celkem 352 271 slonů, z toho 84 % z nich se nachází v chráněných územích. I přes veškerá dosavadní opatření je stále zabíjejí pytláci a jsou toužebným cílem organizací, jež obchodují se slonovinou. Na následky pytláctví ročně ubývá asi 8 % slonů. Nejenže lovci zabíjejí dospělé, leckdy rekordně staré a velké slony, ale spolu s nimi umírají i jejich osiřelá mláďata.", "Loxodonta africana", "Slon africký", null });

