                values: new object[] { 45, new DateTime(2023, 2, 7, 17, 25, 46, 887, DateTimeKind.Utc).AddTicks(7151), "Lachtan hřivnatý (Otaria flavescens) je šelma z čeledi lachtanovití, jediný zástupce rodu Otaria. Žije na západním, jižním a východním pobřeží Jižní Ameriky a také na Falklandách. Charakterizuje ho robustní hlava a hnědá srst. Samec dorůstá až 3 m a až 350 kg. Od samice ho odlišíme díky mohutné hřívě na hlavě, díky které se mu říká lvoun. Je to druh nemigrující, místo, kde se rozmnožuje, využívá po celý rok.", "Otaria byronia", "Lachtan hřivnatý", null });

            migrationBuilder.InsertData(
