                values: new object[] { 44, new DateTime(2023, 2, 7, 17, 25, 46, 887, DateTimeKind.Utc).AddTicks(6918), "Bodlok pestrý (Paracanthurus hepatus (Linnaeus, 1766)) je menší ryba z řádu Acanthuriformes, jediný zástupce rodu bodlok (Paracanthurus). Je známá pro svou výraznou, modrou barvu, díky které získala mnoho přezdívek a také se stala oblíbenou součástí mořských akvárií. Tato ryba je dostupná ve specializovaných prodejnách s akvaristikou, oblíbenost mezi chovateli značně stoupla po uveřejnění filmu Hledá se Nemo, ve kterém představoval zmatenou rybku Dory. Vysoký zájem veřejnosti o bodloka pestrého a další ryby, které se vyskytly v pohádce Hledá se Nemo, zejména pak zájem o klauna očkatého (Amphiprion ocellaris), mohou způsobit těmto druhům ryb značné potíže. Je zaznamenán zvýšený zájem lidí, kteří je chtějí chovat ve svých akváriích, tudíž tyto ryby jsou více loveny ze svých přirozených domovů v mořích, kde jich značně ubývá. Časem by se tedy mohlo stát, že díky tomu dojde k vyhynutí v jejich přirozených stanovištích.", "Paracanthurus hepatus", "Bodlok pestrý", null });

