                values: new object[] { 43, new DateTime(2023, 2, 7, 17, 25, 46, 887, DateTimeKind.Utc).AddTicks(6628), "Sup kapucín (Necrosyrtes monachus) je nejmenším druhem supa žijícím v Africe. Patří mezi kriticky ohrožené druhy.Specifické opeření světle šedohnědé barvy na hlavě od očí dozadu (na temeni hlavy až na krku) dalo tomuto druhu označení kapucín. Přední holá část hlavy je růžová. Na těle má tento sup hnědé peří.Vyskytuje se v otevřených oblastech, na savanách (spíše lesnatých), trnitých buší i poblíž lidských sídel (např. na skládkách) subsaharské Afriky, a to až do nadmořské výšky 4000 m n. m.. Živí se zdechlinami a bezobratlými (většími druhy hmyzu), případně také plazy. Podobně jako jiné druhy supů tedy patří k tzv. \"zdravotní policii\". Protože patří mezi malé druhy supů, má také menší a tenký zobák (zakončený ostrým hákovitým hrotem), kterým sice není schopen roztrhnout kůži na větších mršinách, ale zato se dostane do těla skrz menší otvory mezi kostmi, kam se naopak větší druhy nedostanou.Dosahuje délky 67 až 70 cm a váhy 1,5 až 2,6 kg. Rozpětí křídel se pohybuje v rozmezí 1,7 až 1,8 metru.Snáší jedno vejce, které oba rodiče inkubují po dobu 48 až 54 dní.Je ohrožen zejména cílenými otravami pesticidy, dále lovem pro maso a pro potřeby medicíny.", "Necrosyrtes monachus", "Sup kapucín", null });

